asd(
     CLK := toolSensor,
     Q => toolSensorRE);


IF asd.Q = true then
  toolNumber := toolNumber + 1;
  IF toolNumber = 4 then
    toolNumber := 1;
    end_if;
end_if;

if sensorX1 = 0 then
   motorXRight := 1;
elsif sensorX1 = 1 then
   motorXRight := 0;
end_if;

if sensorY1 = 1 OR sensorY2 = 1 OR sensorY3 = 1 OR sensorY4 = 1 then
  motorYUp := 1;
elsif sensorY0 = 1 then
  motorYUp := 0;
end_if;

if sensorY2 = 1 OR sensorY3 = 1 OR sensorY4 = 1 then
  motorYUp := 1;
elsif sensorY0 = 1 then
  motorYDown := 1;
elsif sensorY1 = 1 then
  motorYUp := 0;
  motorYDown := 0;
  end_if;

if sensorY3 = 1 OR sensorY4 = 1 then
  motorYUp := 1;
elsif sensorY0 = 1 OR sensorY1 = 1 then
  motorYDown := 1;
elsif sensorY2 = 1 then
  motorYUp := 0;
  motorYDown := 0;
  end_if;

if sensorY4 = 1 then
  motorYUp := 1;
  elsif sensorY0 = 1 OR sensorY1 = 1 OR sensorY2 = 1 then
  motorYDown := 1;
elsif sensorY3 = 1 then
  motorYUp := 0;
  motorYDown := 0;
  end_if;

if sensorY0 = 1 OR sensorY1 = 1 OR sensorY2 = 1 OR sensorY3 = 1 then
  motorYDown := 1;
elsif sensorY4 = 1 then
  motorYUp := 0;
  motorYDown := 0;
  end_if;

if sensorX0 = 0 then
  motorXLeft := 1;
elsif sensorX0 = 1 then
  motorXLeft := 0;
end_if;

motorZUp := 0;
motorZDown := 0;

motorYUp := 0;
motorYDown := 0;

motorXRight := 0;
motorXLeft := 0;
